import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Nav from './Componenets/Nav';
import Main from './Routes/Main'

function App() {
  return (
    <BrowserRouter>
      <Nav/>
      <Routes>
        <Route path='/' element={<Main/>}/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
